import BorderWrapper from "react-border-wrapper";

class Example extends React.Component {
    render () {
      return (
        <BorderWrapper
            borderColour= ""
            borderWidth=""
            borderRadius=""
            borderType=""
            innerPadding=""
            >
            {this.state.content === "large" ? <LargeContent/> : this.state.content === "medium" ?
							<MediumContent/> : <SmallContent/>}
        </BorderWrapper>
      )
    }
  }
